from collections import defaultdict

L = inp.split("\n")

D = defaultdict(str)
A = []
for y in range(len(L)):
    for x in range(len(L[0])):
        letter = L[y][x]
        coord = (x, y)
        D[coord] = letter
        if (letter == "A"):
            A.append(coord)

Around = [(1, 1), (-1, -1), (-1, 1), (1, -1)]
def add(t1, t2):
    return (t1[0] + t2[0], t1[1] + t2[1])
def smCheck(lst):
    return "S" in lst and "M" in lst

total = 0
for startCoord in A:
    Letters = []
    for around in Around:
        newCoord = add(startCoord, around)
        Letters.append(D[newCoord])
    if smCheck(Letters[:2]) and smCheck(Letters[2:]):
        total += 1



print(total)
